import React from 'react';
import ReactDOM from 'react-dom/client';

const root = ReactDOM.createRoot(document.getElementById('root'));

function World(arg)
{
  return <div>{arg} world</div>
}

const element = <div class = "container">
<div>{World("Hello")}</div>
<div>{World("GoodBye")}</div>



</div>

root.render(element);
